package sample;

public class relational_operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 20, b = 15;
		System.out.println(a << 2);
		System.out.println(b >> 4);
		System.out.println(a >> 2);
		System.out.println(b << 4);

	}

}


